import { useDispatch, useSelector } from "react-redux";
import { changePath } from "../store";

function Route({children, to})
{
    const currentPath = useSelector((state) => {
        return state.navigation.currentPath;
    })

    if(to != currentPath)
    {
        return;
    }
    return {children};
}

export default Route;
